import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ViewTrack() {
  const [entry, setEntry] = useState([]);

  useEffect(() => {
    fetchEntry();
  }, []);

  const fetchEntry = () => {
    axios
      .get('http://localhost:4000/race/track/all')
      .then((res) => setEntry(res))
      .catch((err) => setEntry(err));
  };
  return <div>Hi</div>;
}

export default ViewTrack;
